import React from 'react'
import Message from '../Message/Messages'
import './Messages.css'
import scrollToBottom from 'react-scroll-to-bottom'

const Messages = ({messages}) => {
    return(
        <scrollToBottom>
         {messages.map((message,i) => <div ke={i}><Message /></div>)}
        </scrollToBottom>
    )
}

export default Messages
